&quot;200&quot; is the fifth episode of the fourteenth season of South Park, and the 200th overall episode of the series. It originally aired on Comedy Central in the United States on April 14, 2010. In the episode, all celebrities who have been mocked by residents of South Park plan to file a class action lawsuit against the town. Tom Cruise promises to end the lawsuit if the town can produce the Muslim prophet Muhammad.

The episode was written and directed by series co-creator Trey Parker, and was rated TV-MA L in the United States and TV-14 in Canada. To celebrate their landmark episode, Parker and fellow series co-creator Matt Stone decided to write a new episode combining many of South Park's past story lines and controversies. The Muhammad subplot, similar to one previously featured the tenth season episode &quot;Cartoon Wars&quot;, refers to Comedy Central's past refusal to allow images of Muhammad to be shown on the network following controversies 2005 and 2007 in cartoons in European newspapers resulted in riots and threats.

&quot;200&quot; includes many celebrities that have been mocked in previous episodes, including Cruise, Rob Reiner, Steven Spielberg, George Lucas and Mel Gibson. The episode also involves a subplot in which Cartman learns he may not know the true identity of his father. It was said in the second season episode &quot;Cartman's Mom Is Still a Dirty Slut&quot; that his intersexual mother is his father, but the events of &quot;200&quot; and the subsequent episode reveal that this was not the case.

&quot;200&quot; received mostly positive reviews. According to Nielsen Media Research, the episode was seen by 3.33 million viewers, making it the most watched cable television program of the night. Within a week of the episode's original broadcast date, the website for the radical Muslim organization Revolution Muslim posted an entry warning Parker and Stone they risked getting murdered for airing the episode. Although the site insisted the entry was a warning, several media outlets and observers interpreted it as a threat. As a result, Comedy Central heavily censored portions of the sequel episode, &quot;201&quot;, by removing images and references to Muhammad.



